import React from "react"
import {
    Input,
    CreateField,} from "../../assetss/common/ValidatorsComponents/ElementsValidators";
import {MaxLengthCreator, required} from "../../utils/validators";
import ts from "./Tasks.module.css";
import TaskDoneIcon from "./DoneIcone";
import NotDoneIcon from "./NotDoneIcon";
import DeleteButton from "./DeleteTaskButton";




const TaskEditForm = (props) => {

    return <div>

        <form onSubmit={props.handleSubmit}>
            <button >
                Save changes
            </button>
            <button  onClick={props.TaskEditModeOFF}>
                go back
            </button>


            <div >
                <div className={props.TaskExecutedStyleForWindow}>
                    <div className={ts.TaskBodyWrapper}>
                        <div>
                            {CreateField("key","key", [],{type: "checkbox"})}
                        </div>

                        <div className={ts.Title}>
                            {CreateField("key","key", [],Input )}
                        </div>


                        <div className={ts.ToTrashIcon}>

                        </div>

                    </div>
            </div>

            </div>

        </form>
    </div>
}

export default TaskEditForm
